import React from 'react';
import './card.css'

const card = (props) => {
    return (
        <div className="card">
            <div className="image">
                <img src={props.card.image} alt=""/>
            </div>
            <div className="name">
                <h3>{props.card.name}</h3>
                <small>{props.card.salary}</small>
            </div>
            
        </div>
    );
};

export default card;
